import React from 'react';
import web from './images/img1.svg';
import { NavLink } from 'react-router-dom';
import Common from './Common';
const Home = ()=>{
    return (
        <>
        <Common name="Welc page" imgsrc={web} visit="/contact" btname="Contact Now"  />
        </>
    );
};
export default Home;
